import iconCart from "../../images/icon-cart.svg";
import avatar from "../../images/image-avatar.png";

const RightNav = () => {
  return (
    <div className="cart bg-red-200 flex items-center justify-between w-1/12">
      <a href="#">
        <img src={iconCart} alt="cart-button" />
      </a>
      <a href="#">
        <img src={avatar} width={50} alt="profile-avatar" />
      </a>
    </div>
  );
};

export default RightNav;
